                        {
                            Id = 74,
                            Address = "Alexandria / Egypt",
                            AreaTypeId = 3,
                            Description = "The Mamoura Bay at Alexandria is a vast bay stretching from the royal Montaza gardens in the west to the gulf of Abu Qir in the east. The bay was the gateway to the ships coming from the Mediterranean on their way to the Nile. By hugging the coast of the bay, the ships traveled to the Canopic branch of the Nile and transported their goods to all of Egypt. Pottery sherds and amphorae were found scattered on the bay’s seabed, a testament to the many shipwrecks that took place here. The artifacts testify to the flourishing trade between Egypt and the world. A survey of the seabed revealed an ancient Roman shipwreck, remains of which are still present today. Little is known about Mamoura Bay, but excavations are gradually providing us with information on the area. A small port and paving dating to the Greco-Roman Period were found, along with the limestone quarry that was used to build them. Rock cut basins were also discovered and are thought to be evidence of fish farming, raising the possibility of a settlement that was once located here",
                            ImageUrl = "AreaImages/photo-alexandria-8.jpg",
