            modelBuilder.Entity("Egyptos.Domain.Entities.Historical", b =>
                {
                    b.Property<int>("Id")
                        .ValueGeneratedOnAdd()
                        .HasColumnType("int");

                    SqlServerPropertyBuilderExtensions.UseIdentityColumn(b.Property<int>("Id"));

                    b.Property<string>("Date")
                        .IsRequired()
                        .HasColumnType("nvarchar(max)");

                    b.Property<string>("Description")
                        .IsRequired()
                        .HasColumnType("nvarchar(max)");

                    b.Property<string>("ImageUrl")
                        .IsRequired()
                        .HasColumnType("nvarchar(max)");

                    b.Property<string>("Title")
                        .IsRequired()
                        .HasColumnType("nvarchar(max)");

                    b.HasKey("Id");

                    b.ToTable("Historicals");

                    b.HasData(
                        new
                        {
                            Id = 1,
                            Date = "1171 AD / 1250 AD",
                            Description = "The Ayyubid state was founded by Saladin, who defeated the Fatimids and expelled them from Egypt in 567 AH / 1174 AD, and Egypt returned under the rule of the Abbasid Caliphate again.  Saladin worked to spread the Sunni doctrine instead of the Shiite doctrine that was prevalent in the Fatimid era.  The Ayyubid state was a military state as it appeared during the Crusades in Egypt and the Levant.  In light of this political context, Saladin decided to build a castle in Cairo, which began construction in 527 AH / 1176 AD, but its completion was not completed during his lifetime, but later in 1208 AD. Therefore, the rule of Egypt extended to the Levant, the Hijaz, Yemen, Nubia and parts of North Africa. The Ayyubid era in Egypt lasted for 81 years and ended at the hands of the Mamluks.",
                            ImageUrl = "HistoricalImages/1.jpg",
                            Title = "Ayyubid State"
                        },
                        new
                        {
                            Id = 2,
                            Date = "1550 BC / 1069 BC",
                            Description = "During the New Kingdom, Egypt became a great empire that stretched across the ancient Near East, reaching as far south as the Fourth Cataract in Nubia, and as far north as the Levant. The Egyptian economy flourished to an astonishing degree, and most of the most famous and impressive ancient Egyptian monuments date back to this great period.  The Eighteenth Dynasty (1550-1295 BC) began with King Ahmose, who expelled the Hyksos, a Semitic people who ruled most of Egypt during the Second Intermediate Period. Most of the kings of the New Kingdom pursued an expansionist foreign policy in response to what had happened before, and the wealth generated by the expansions was used to carry out many construction projects throughout Egypt, especially at the Karnak Temple in Luxor, the most important temple of Amun, the lord of Thebes. Most of the kings of this dynasty were buried in the famous Valley of the Kings.  Art, architecture, and the national economy reached new heights under Hatshepsut. Unfortunately, her husband, Thutmose II, did not rule for long, while his son from another wife, Thutmose III, was still too young to rule. So the Great Royal Wife Hatshepsut, perhaps in order to secure the throne of Egypt, declared herself king alongside her young stepson. Hatshepsut developed a new concept of kingship and linked herself to a divine birth from the god Amun to legitimize her reign, leaving a profound mark on the geographic, religious, and political landscape of Thebes.  Thutmose III proved to be the most capable king of all. During his reign, Egypt’s borders were extended farther, and his influence extended throughout the Nile Valley, including Nubia, leaving many monuments at the Karnak Temple, as Hatshepsut had done before. Peace was achieved in the region during the reign of his son Amenhotep II, and both the state of peace and increased international trade bore fruit under his successor Amenhotep III. Few kings matched him in the quality, scale, and quantity of his building projects, as he built many structures throughout Egypt and Nubia, including half of the Luxor Temple as it stands today.  However, Amenhotep IV, son of Amenhotep III, changed his name to Akhenaten and declared his rebellion against the rest of the gods and that there is only one god, Aten, who was represented as the sun disk in the sky. His reign witnessed other revolutionary changes in royal ideology, art, architecture and language. However, he neglected Egypt's foreign affairs, and by the end of his reign, Egypt's lands in the Levant (the area of ​​Palestine, Lebanon and Syria) were lost.  A turbulent period followed his reign, with Horemheb - a former army commander - ascending to the throne and completing the return of things to normal, appointing the commander Bar-Amesu as his successor. With his ascension to the throne under the name Ramesses I, the Nineteenth Dynasty (c. 1295-1186 BC) began, and his son Seti I succeeded him and ushered in an era of prosperity in Egypt. He also carried out many military campaigns, the most important of which were against the Hittites, who emerged as a new power in the ancient Near East, and regained much of Egypt's lost lands in the Levant.  His son Ramses II the Great was one of the most successful kings in ancient Egyptian history. During his long reign he waged many successful wars, achieved the first peace treaty with the Hittites, and left more monuments throughout Egypt than any other king. Meanwhile, his successor and son Merneptah launched a major attack against tribes called the \"Sea Peoples\", and by the end of his reign the Nineteenth Dynasty declined.  With the reign of King Setnakht, founder of the Twentieth Dynasty (1896-1069 BC), order returned to the country, and his son Ramses III was the last great warrior of the New Kingdom. After him, the state deteriorated steadily until it was divided into two parts. The next dynasty ruled only Lower Egypt, while Upper Egypt remained under the rule of the priests. The New Kingdom",
                            ImageUrl = "HistoricalImages/8.jpeg",
                            Title = "Modern State"
                        },
                        new
