                            Id = 3,
                            Date = "868 AD / 905 AD",
                            Description = "The Tulunids established the first independent state in Egypt during the Abbasid era, during which Egypt was able to retain all its wealth. Ahmed Ibn Tulun, the founder of the Tulunid state, carried out many economic and cultural reforms, where he began by establishing a new administrative capital called Al-Qata'i, and built his mos que, currently known as the Ibn Tulun Mosque. The rule of the Tulunids lasted for about thirty-five years, after which came the Ikhshidids.",
                            ImageUrl = "HistoricalImages/12.jpg",
                            Title = "Tulunid State"
                        },
                        new
                        {
                            Id = 4,
                            Date = "912 AD / 1171 AD",
                            Description = "The Fatimid state was the golden age of Egypt, in which Islamic art was completed, as Egyptian artists left behind many monuments and artifacts that testify to their superior skill and precision in various artistic forms. The Fatimids invaded Egypt in 358 AH / 969 AD, then established a new city north of Fustat, which they called \"Cairo\", making it their capital. Al-Azhar Mosque was the first mosque they built in Cairo.",
                            ImageUrl = "HistoricalImages/16.jpg",
                            Title = "Fatimid State"
                        },
                        new
                        {
                            Id = 5,
                            Date = "2686 BC / 2181 BC",
                            Description = "The Old Kingdom extends through the third to sixth dynasties, as the king's power increased during that period. King Djoser, the first king of the Third Dynasty, built his step pyramid in Saqqara. He wanted to build a mastaba-shaped tomb in the style of his predecessors, the kings of the First and Second Dynasties, but those mastabas increased to reach about five mastabas, one above the other.To be the first stone step pyramid in the country's history. But his successors were unable to complete their pyramids, perhaps due to the short duration of their rule. We do not know much about King Huni, the first king of the Fourth Dynasty, while the second king, Senefru (2613-2589 BC), was very powerful and advanced. He alone built three pyramids, the first of which was in the city of Meidum, which began as a step pyramid and then ended as a complete pyramid. . As for the second, he built it in Dahshur and is known as the Bent Pyramid or the Broken Pyramid. It was the first attempt to build a pyramid.Complete, but its construction was not completed as he wanted, while the third pyramid, known as the Red Pyramid in Dahshur, was the first complete pyramid in Egypt, which opened the way for the construction of complete pyramids. This was achieved during the reign of his successor, King Khufu (c. 2589 - 2566 BC), who built the largest pyramid and pyramid group. The Great Pyramid, with an original height of 146.5 metres, was the tallest building in the world for 3,800 years. Khufu's son and successor, Ra (about 2566 - 2558 BC), did not complete his pyramid at Abu Rawash. He was succeeded by Khafre (ca. 2555 - 2532 BC), during whose reign he carved the Great Sphinx and built a pyramid nearly the size of his father's pyramid. As for the two temples connected to the pyramid, they were larger and more detailed than the temples of its predecessors. The pyramid of Menkaure (2532 - 2503 BC), son of King Khafre, is considered an example of the beginning of the decline of royal authority. Although his pyramid was considerably smaller than its predecessors, at least a quarter of it was covered in granite, a stone brought from Aswan that was difficult to obtain and transport. Moreover, the temples adjacent to his temple are relatively larger than their predecessors, indicating a shift in the king's priorities from his tomb to the worship to be practiced in these temples. This trend grew more pronounced during the Fifth Dynasty (ca. 2449 - 2487 BC) and the Sixth Dynasty (ca. 2345 - 1821 BC). The last king of the Fifth Dynasty, Unas, ordered the creation of inscriptions inside his pyramid at Saqqara, known as the Pyramid Texts, an introduction to a famous series of texts known as the Book of the Dead. The purpose of these texts was to help the king successfully reach the afterlife and become a deity. Beginning in the Sixth Dynasty it became clear that the king's authority had declined. In addition to other factors, by the end of the long reign of its last king, Pipi II (c. 278-2184 BC), Egypt was no longer under the control of a central government.",
                            ImageUrl = "HistoricalImages/22.webp",
                            Title = "Old Kingdom"
                        },
                        new
                        {
                            Id = 6,
                            Date = "2055 BC / 1650 BC",
                            Description = "The Middle Kingdom was a period of great prosperity, consisting of the Eleventh to Thirteenth Dynasties. Although the Eleventh Dynasty had its origins in the First Intermediate Period, the last king of this era who succeeded in unifying Egypt, thus beginning the Middle Kingdom, was King Nebhepetre Mentuhotep (ca. 2055 - 2004 BC). The Eleventh Dynasty came from Thebes (now Luxor). It was not an important city during that period, but it will become one of the most prominent and important cities in Egypt during the rest of ancient Egyptian history Because of his Theban origins, Nebhepetre-Mentuhotep was buried on the western mainland of Thebes in the Deir el-Bahri area. His tomb included a temple for his funeral rituals. The tomb was partly cut into a rocky slope, while part of it was built in the form of a terrace that included an ascending middle slope. This temple was clearly a partial inspiration for the neighboring and more famous temple of Queen Hatshepsut to its immediate left. Little is known about Mentuhotep III and IV, the last rulers of the Eleventh Dynasty. Amenemhat I (1985-1955 BC) was the first king of the Twelfth Dynasty (1985-1795 BC) and was probably the vizier of Mentuhotep IV. The kings of this highly successful dynasty consolidated the authority of the central government over all of Egypt, and during this period the powerful provincial rulers were reined in.They also undertook building projects throughout the country, strengthened its borders, sent mining expeditions, and encouraged trade voyages. A series of forts, such as those at Bohn, Semna and Ascot, not only served as defensive fortresses but regulated the movement of incoming Nubian traders and were bases for mining and military operations. The reign of Kings Senusret III (1874-1855 BC) and Amenemhat III (1850-1808 BC) was particularly prosperous. Huge agricultural projects were implemented during that period, especially in the Fayoum region in Central Egypt, where canals were dug, part of the lake was dredged, and the resulting lands were reclaimed for agriculture. The kings of the Twelfth Dynasty in this region were buried in huge pyramids near the new capital founded by Amenemhat I, which was called Etet Tawi, meaning the Holder of the Two Lands, and its exact location is still unknown. The Middle Kingdom represented an important shift in the history of ancient Egyptian culture, as its most important contributions to ancient Egyptian language and literature were: new linguistic structures emerged and many new literary texts were written, many of which remain popular for more than a millennium. The language used to write these texts, with its grammatical rules, is called the Middle Egyptian language, which will serve as the language of official texts until the Ptolemaic era (332-30 BC) and the Roman era (30 BC - 395 AD).",
                            ImageUrl = "HistoricalImages/26.jpg",
                            Title = "Middle Kingdom"
