                            Id = 7,
                            Date = "661 AD / 750 AD",
                            Description = "The Umayyad Caliphate was founded by Muawiyah ibn Abi Sufyan, and the Umayyad rule lasted for nearly a century. The borders of the Umayyad state extended to Europe and the edges of Asia, however, the caliphate collapsed during the reign of Caliph Hisham ibn Abd al-Malik. Damascus was the center of government, and Egypt was one of its states. Amr ibn al-Aas was appointed governor of Egypt for the second time by Caliph Muawiyah ibn Abi Sufyan (38-43 AH), and he is considered the first ruler of Egypt during this period.",
                            ImageUrl = "HistoricalImages/31.jpg",
                            Title = "Umayyad era"
                        },
                        new
                        {
                            Id = 8,
                            Date = "332 BC / 30 BC",
                            Description = "Egypt became part of the Macedonian Empire after Alexander the Great defeated the Persian king Darius III in 332 BC. After Alexander's death in 323 BC and the division of his estate among his generals, Egypt came under the rule of Ptolemy I (Soter), who made Egypt an independent kingdom known as the Ptolemaic state. Ptolemy I completed the construction of the new capital of Egypt - Alexandria, and began building the Lighthouse of Alexandria and gathered both Egyptian and Greek priests in order to establish a new faith that would unite Egyptians and Greeks together. During the reign of his successor, Ptolemy II, the arts and sciences flourished and the ancient Library of Alexandria was established, which was the largest library in the ancient world, which led to the influx of Greek scholars and thinkers to Egypt and increased cultural diversity and merged the new Greek civilization with the ancient Egyptian civilization. Various Greek settlements were established in Egypt during the Ptolemaic period as major central areas for Greek citizens who came to Egypt with their culture and traditions, such as \"Ptolemae\" in Upper Egypt, \"Philadelphia\" in Fayoum, and \"Naukratis\", which was the first Greek settlement and a center of trade between Egyptians and Greeks in the Delta, which was established during the Late Period. In the ancient capital of Memphis, Greek settlers established their settlement around the main temple of Ptah in the early Ptolemaic period. The rule of the Ptolemies in Egypt came to a tragic end when they were defeated by the Romans at the Battle of Actium in 31 BC, which led to the suicide of Queen Cleopatra VII and the killing of her son, Ptolemy XV Caesarion.",
                            ImageUrl = "HistoricalImages/36.jpg",
