                            Id = 9,
                            Date = "30 BC / 395 AD",
                            Description = "After the naval battle of Actium and the defeat of Antony and Queen Cleopatra VII in 31 BC by the commander Octavian (Augustus), Egypt lost its independence and became a province of the new empire ruled by the Roman emperor, who was installed as pharaoh and the country was divided into three regions, each ruled by a local governor, but all of them were under the authority of the emperor. Things Egypt exploited Egypt Abad, and some emperors were interested in Egypt in particular, such as the Roman emperor Hadrian who visited Egypt and established the new Roman tariff called \"Antineopolis\", and the Romans talked about new agricultural techniques where they built new water chambers and dams, in addition to increasing grain production and expanding the cultivation of wine. All of these agricultural divisions include their primary goal to be the \"breadbasket of the ancient world\" and nothing more. Life in Egypt was influenced by a multi-festival culture during the Roman Empire and was involved in artistic influences from Greek and Roman culture, leading to the emergence of a unique artistic style and demonstrating the Egyptian intellectual influence in the spread of the worship of Isis throughout the Roman Empire. In 285 AD the Roman Empire was divided into an Eastern and Western Empire, and the new state ended with the fall of Rome to the attacks of the Berbers, while the Eastern Empire took control and became known as the Byzantine Empire in 330 AD.",
